package com.java.prac;

import java.util.HashSet;

public class Longestsubstringwithdistinctcharacters {
    public static int findLongestsubstringwithdistinctcharacters(String s){
        int maxlength=0, count=0;
        HashSet<Character> hsc=new HashSet<>();

        for(int i=0;i<s.length();i++){
            while(hsc.contains(s.charAt(i))){
                hsc.remove(s.charAt(count));
                count++;
            }
            hsc.add(s.charAt(i));
            maxlength=Math.max(maxlength, hsc.size());
        }
        return maxlength;
    }
    public static void main(String args[]){
        // String  s = "";
        //String s="abcdefabcbb";
        String s="geeksforgeeks";
        //String s="geeks";
        //String s="geksedf";

        int count =findLongestsubstringwithdistinctcharacters(s);
        System.out.println(count);
    }
}

